import useFetch from "./useFetch";

const BlogDetails = () => {
  let { id } = useParams();
  const { data: blog, error } = useFetch(" http://localhost:8000/blogs/" + id);
  console.log(blog);
  return (
    <div className="blog-details">
        {blog }
    </div>
  );
};

export default BlogDetails;
